import React,{useEffect,useState} from 'react'
import './App.css';
import axios from 'axios';

const Full = () => {
  const [coin, setCoin] = useState([])
  const [stats, setStats] = useState({})
  useEffect(() => {
    axios.get("https://coinranking1.p.rapidapi.com/coins",{
      params: {
        referenceCurrencyUuid: 'yhjMzLPhuIDl',
        timePeriod: '24h',
        orderBy: 'marketCap',
        orderDirection: 'desc',
        limit: '10',
        offset: '0'
      },
      headers: {
        'X-RapidAPI-Key': 'd00cef50edmshebd666b51e7e5e2p144803jsnebecc2a2481c',
        'X-RapidAPI-Host': 'coinranking1.p.rapidapi.com'
      }
    })
    .then((response)=>{
      setCoin(response.data.data.coins)
      setStats(response.data.data.stats)
    })
    .catch((error)=>{console.log('error', error)})
  }, [])
  return (
    <div>
      <div className='mainNavBar'>
        <div className='subPart'>
            <div className='mainPage'>
              <div className='inp'>
                  <input type="text" placeholder='Search Here' className='mainInp'/>
              </div>
            </div>
        </div>
      </div>    
    </div>
  )
}

export default Full
